import React, {Component} from 'react';
import {Nav} from "react-bootstrap";
import NavDropdown from "react-bootstrap/NavDropdown";

class Navbarboostrap extends Component {
    render() {
        const logoStyle = {
            color: "blue",
            cursor : "pointer"
        };
        const textStyle = {
            fontSize: "15px",
            fontWeight: "bold"
        };

        function openLink(link,event)
        {
            console.log(event.target);
            var win = window.open(link, '_blank');
            win.focus();
        };

        return (
            <div>
                <Navbarboostrap bg="light" expand="lg">
                    <Navbarboostrap.Brand href="#home">React-Bootstrap</Navbarboostrap.Brand>
                    <Navbarboostrap.Toggle aria-controls="basic-navbar-nav" />
                    <Navbarboostrap.Collapse id="basic-navbar-nav">
                        <Nav className="mr-auto">
                            <Nav.Link href="#home">Home</Nav.Link>
                            <Nav.Link href="#link">Link</Nav.Link>
                            <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                                <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                        <Form inline>
                            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                            <Button variant="outline-success">Search</Button>
                        </Form>
                    </Navbarboostrap.Collapse>
                </Navbarboostrap>
            </div>
        );
    }
}

export default Navbarboostrap;
